ds%2Fmagazine%2Fcontent%2F218a4543c6d7f520272774621db55549_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fb42f49dd55572ea7395b0faee957480d_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fe32d6a98b312802687081e6fcde53334_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F7046b478ef98eab2a93a1aee37e80807_magazine_web_m.jpg', '17,20,22,54,55,10,59', '2018-09-11 21:50:41', '15', '1'), ('230', '田芯娜Angel', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2Ff60c49c1928c1cf0de8d7acbf7acf351_cover_web_m.jpg', '总是希望时间可以停住，总是希望青春可以不说再见，美丽的脸庞可以拥有永远。漂亮的女孩幻想这一切，聪明的女孩却在有限的时间完美的改变。清纯无比的软妹田熙玥，这个百变女郎，无论是帅气干练的女刑警还是性感撩人与黑夜同款的紧身皮衣，亦邪亦正，徘徊在狂野和纯情之间她都游刃有余。更加可爱的是那身蓝色的连身兔女郎装，真是令人充满幻想。', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fcb3e8fe6f33d3296fd87ebbd8dc2db91_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F8d148aea4c4f839ff1fba814d124219c_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F5d5e75754836972eec88ca567d36b3aa_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fd60fddfda2a7eb67e2f07888849d06c1_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F5f82ca425115ce2ad65ee2b841c458d1_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F8a6a979d16aac67cf6259f58a3f4cf6e_magazine_web_m.jpg', '20,22,25', '2018-11-19 21:17:35', '13', '1'), ('231', '苏糯米', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2Fdd9957f0f345827d20eea156247ce243_cover_web_m.jpg', '很难想象，前两天我们还在新世纪最冷的一天中流鼻涕。今天，春天就已经悄悄来了。在这春意浓浓的立春之际，派出我们的青春代表，鲜嫩多汁，最有春之气息的元气女神苏糯米登场！看起来酥软米糯的她，穿着蓝色格子比基尼，还在赖床。窗边，一会儿是偷偷化妆的小妖精，一会儿是像天使一般的纯情少女，光晕洒在她的肩上，臀上，美的似乎连周边的尘埃都可爱了起来。当奶液顺着她的嘴角流出的时候，那享受的滋味真是“唇唇欲动”。', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F630e790afd5fecd5b41b694f18dde0bd_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagaz