INSERT INTO `tb_ugirls` VALUES ('232', '谭晓彤', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2Fb80b1ba554d93ab8fbbbad8e9fdc4041_cover_web_m.jpg', '患了强迫症的尤果宝宝，怎么可能放过新春特辑呢？有眼福了您嘞~这火红的祝福，正是我们浓浓的热情与爱意。肿么样！大过年的还能有新专辑！是不是很感动呀~跟着尤果有美肉！所以，我们推出三大风格迥异但却都穿着小肚兜的大大大美人！哪里大？看了新专辑你就知道啦~最后还要祝您新年行大运，发大财，抱大美人！', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F98e704f61d59e7f3e35b413e509e94dc_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F3b24fa0ded123e9b30df7ad01ac16568_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F9747ef6fd250a4f906535240ca39cd58_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F5e3ed52867c42affa6bc67b8aa56ee9e_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F87f37f64df47b27bd0b6a6b5f7330c7f_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fd7462434a17c33555f9206ec18f0b577_magazine_web_m.jpg', '17,20', '2018-11-19 21:17:34', '10', '1'), ('235', '王雨纯', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2F76401511ed900a8772855a87e1b55497_cover_web_m.jpg', '她靠在清晨被阳光爱抚过的沙发上，百合花散发出淡淡的香味，我分不清是女人香还是花香，总之令人着迷。酒精像是淘气的精灵，让她的脸红扑扑的，眼神迷离着，嘴里呢喃着什么，看着就很想亲吻她。她换上平时在夜店的表演服，香味弥漫不散，气氛有些令人心疼，但我想我会更爱她，女香王雨纯。', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Faee3f9eb0d5f003d607cc8130875a393_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F992afb4136cc5833c9b6c65c1505970b_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F12d48b908bd521c82ac55eb3898461d2_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fa9828d9e4d128447bbc69e6628617e89_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fe398cc66b11fa7b1987b2556970ed987_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fd13ae9dc6c770715e9f9927559402f4f_magazine_web_m.jpg', '17,20,22', '2018-11-19 21:17:33', '12', '1'), ('236', 'Bunny', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2F9f3299319a983064d9c6a8aecd9b9af6_cover_web_m.jpg', '我们总是把看起来像稚女，但身材火爆至极的美女称为“童颜巨乳”她们的存在也总是满足了大部分宅男对另一半的各种幻想。我们曾经推出萝莉养成计划，曾经提供“一日女友”特辑。但今天，我们把真正的童颜巨乳和一日女友相结合，诞生了可爱的小美女，Bunny 。Bunny 本身就是一名摄影师，专为儿童提供写真服务，性格也像长不大的小朋友，爱撒娇，爱臭美~要不是胸前那对所有眼神都不能避开的火爆胸器，她真的就像是长不大的小女孩！这样的女孩你是否喜欢呢？', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F89e29ad04b5363c558b2571f8c6f3458_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F708bc56a057615eab6a9592e5503b4cb_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Febd6da167af6e63b29da3d79743f35a9_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F04af26771e194d36ca3b8cc38f0e87fc_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fbdc091d7de1846ff65746cac69e776f6_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fb95d78c474983f390609d98c6236dcf4_magazine_web_m.jpg', '37,19', '2018-09-11 21:50:41', '11', '1'), ('237', '小吉', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2Fdee97d21294fb587e8ebd6b407c9afd5_cover_web_m.jpg', '也许你未曾体会一见钟情，但你一定在某个瞬间为她动心。当你的耳朵红了起来，心跳加速，呼吸急促，甚至感到从未有过的沸腾，那么你一定是被她注射了爱情的催化剂！春天的阳光总是那么柔情，就像我们的嫩模吉吉，美的没有任何攻击性，甜美的就像从一本爱情小说里走出来的女主角。她身披阳光，笑的像花儿一样，纤柔的身体微微感觉承受不住颈下的汹涌。几套比基尼更是热辣充满魅力。她用雪白的皮肤做最美的衣裳，以花朵当做背景，浪漫的卷发和星空一般的眼睛。就是她用多巴胺迷住了你的神经！', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F19639d8fa2dc54c42fb75f6899ca538e_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fed263ef58366252ca20a5efb37ace7af_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fadde20f351448c628139c4ef4029951f_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fb586781b1b16c11c8e8ec34b892095c7_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F242c03117f9dca77c16afdda1d552e2b_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fcfedfba3a624d1b0cc76f98b4e7b3b54_magazine_web_m.jpg', '37,39,19', '2018-09-11 21:50:41', '11', '1'), ('239', '温鈊怡', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2F0ab21b7ea6dfad5b428125f994504fc3_cover_web_m.jpg', '她坐在窗边，本宜安静之形而见胸前那惊人之胸器破之尽。金之绡与蓝底蕾丝泽为了两套香艳绝之矣。其嚬笑似皆可得波涛之栗。于是一美人身上，汝不得谦虚二字。玫瑰碎花使其性感中多了一妖娆。是犹小白猫之性感豹猫态，其皆御之甚得。使君亦有欲欲有此一爱獠之小猫咪。', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fdbd6d68df7bc58ada8428112fa041428_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F2181925a7d8730851e111c65966b0b63_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F2337808d3b1bdd0ae341af483f533f6b_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Facbfacda2870c5be68cd291d60739073_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F2314716e8f83cf368ce05ab997ed70c4_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F45301637099e53f44cc6a008278189b1_magazine_web_m.jpg', '20,22', '2018-11-19 21:17:32', '18', '1'), ('240', '文静', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2Ff4dae2018f1f33d84ef86370af414a6d_cover_web_m.jpg', '爱情不是谁对谁错，不是无限要自由，你做了偷心的大盗，谁又能为爱而守护。新制服诱惑女警文静带着她的小手铐来了，谁还敢犯拿爱做借口的错！你也好奇女警花儿们卸下制服那一刻是什么样，当黑色蕾丝内衣小荷才露尖尖角，我似乎听见了你狂躁的心跳。居家的男友衬衫更显出了她娇柔的一面，阳光下的恬静，永远扣不上的纽扣，这一静一动的画面出奇的好看。桃色的绫罗与肌肤缠绕着，每一眼都是享受。看太多又怕被套上爱的枷锁。', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fed35b19a48658a37377f7317b615c11e_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F9752dcf9fa2424a263ed7b890b391426_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F7af4314bb5a27f4d595eb60765580fce_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fdad4eaf5f5f8fe369e7c07b0c3028693_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fbdf74e81d7d67f7f0a6f14be4f648f26_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F59f3d8993c36b5d1bb7aadff84f87223_magazine_web_m.jpg', '17,22', '2018-11-19 21:17:32', '13', '1'), ('241', '仙妮', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2Fae59bc08ade3fb940d964b50baa00166_cover_web_m.jpg', '玲珑骰子安红豆，入骨相思知不知，初见便难以忘怀，柔顺的长发垂睡在白皙的肌肤上，回眸一笑的瞬间，长睫好似弯月，忽闪忽闪的。星眸微启，千百种妩媚顺势而生。无论是丝绸的和服还是蕾丝的内衣，最吸引人目光的还是那完美曲线，纤腰柔软的好似初春的新柳，举手投足之间都充满了飘飘仙气。笑起来的时候最甜，丰盈的粉唇，像饱满的花瓣，似乎还能闻到一丝芬芳。都把绝色美人比作画中仙子，仙妮便是之一。', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fb99de2be8f74c784f5f9bf7b51c85556_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fc4bad3d7b2cdfbe3575f48ca3893ef34_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Ffd986a6e0d5fa3a4485e5ce28f40b2ad_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F5847fe115b9f7071dd2e369b1c07cee5_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fcbecadd0aaf4a030d67af537e5120f9f_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F03aa319c029a88a5c1b4dff89278b774_magazine_web_m.jpg', '17,20,22', '2018-11-19 21:17:32', '12', '1'), ('242', '小米Kitty', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2F1dba2d011d3b0fe23b248c8d22f17030_cover_web_m.jpg', '那娇滴滴的春花不知道被昨晚的风吹去了多少，只怪春夜太美让人酣睡不知道早已破晓。当一米阳光透过窗的时候，女主角才从春风中醒来。她叫赵小米，天生一副无公害的面容可谓老少通吃，招人稀罕。春天也是最适宜观赏这种清水出芙蓉，天然去雕饰的治愈系少女。她一身运动短装，仿佛带你置身于学生时代的春季运动会，雪白的大长腿真是任性！粉色条纹比基尼和粉色小兔装更是萌出新高度！荷叶边紧身衣加上两股俏皮的大辫子，可爱加分的同时，她那来自“春天的祝福”也是诚意满满~', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F6b600f75b828182b55142b98a31ccba5_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fb7f9314189cd074ce5e5433456571275_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fe9509a1127ee32642bfd017443f7a2d6_magazine_web_m.jpg,https%3