操作，令他们出现幻觉、幻听，甚至能在一定程度内改变记忆。这要是勾起人来，绝对是神魂颠倒的状态。最后我们的coser禅叽恢复了本来的样子，不变的是那傲人的胸器与清纯的脸蛋，一次奇幻的异次元之恋。', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F3436133320d5d38bc8f9cccb20d8dc97_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F36f21d7e96e56b34206a657865dc6702_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F096a535b2e414d02f6845dd16a1d2cb5_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F52de6c20375ceca42b8b5918200bd9c6_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F39341b01e3808757ce3bba9c03a82206_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F2d04690839016b18e3e2c79bd97d6b53_magazine_web_m.jpg', '54,13', '2018-09-11 21:50:41', '15', '1'), ('253', 'Enjoy', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2F9c420188a1e9bb22ba017d94596ebbb3_cover_web_m.jpg', '卷翘的睫毛,水灵灵的大眼睛,精致高挺的鼻子,爱嘟起的樱桃粉唇.笑起来像初春绽放的蒲公英一样,明媚的一眼就能看见.一身棒球装,可爱加分,俏皮加分.那浅紫色的蕾丝内衣加上极好的身材.完美的曲线.又像是夏天湖畔含苞欲放的藕禾,婷婷玉立.深红色的蕾丝内衣在她的身上,出奇的好看.荧光色的大蝴蝶节比基尼让人忍不住想要把她当作礼物一样拆开.想在她的身边弹吉他.想要她的眼睛看过来~', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F3d3d6f738532fd96113898d0f04c1af3_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F91dfb9f7e10036547b73e3867e8a9ee6_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F18a995be6acc3d569bc423bc920c1fb0_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fd8a4d412787a1134163e52bdbe4ec430_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F2c6d50a0c799ebbc86574e7913eaba4a_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F69859a113fc17e025dca1d0f9cbfd309_magazine_web_m.jpg', '17,22,13', '2018-11-19 21:17:27', '18', '1'), ('254', '于思琪', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2F0add0dc0d39350729dc427e177015ab5_cover_web_