zine%2Fcontent%2Fa4a1d5105968a4b68989cd221b266463_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F26accec5ccdc1435003581da6e7d1d2a_magazine_web_m.jpg', '68,103,95', '2018-11-19 21:17:15', '8', '1'), ('291', '顾籼', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2Fab60c7f6617378a6b1c0ab29c93cd1ee_cover_web_m.jpg', '很抱歉，我们这么晚才把这灵气动人的小仙女顾籼送到你的眼前，起初她一身黑色连衣裙，裙带垂落在香肩上，摇摇欲坠的样 子令人无限遐想。再一身白色吊带衫，强烈的冷暖光对比使得整幅画面充满视觉冲击。透视内衣再加淡绿色薄纱，香艳难以掩藏，完美的胸 型和活泼的翘臀真是美丽极了！', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Ff62811cd5e43bde298a660b99c8a0725_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F65a53caeba117abb2eda192a0b165b4b_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F63839349e8e18c7943da2a9ac6555fd2_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fb77a9dfbcfe8af266c1fcf5a0fd6d676_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F7f80e69236635cc59a5e79d7e4bf0e7d_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F31982a7f12c549b15e4a0eab2cec639d_magazine_web_m.jpg', '103,77', '2018-11-19 21:17:14', '8', '1'), ('292', '香川颖', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2F23b85e60c97ea06911bbe51246925578_cover_web_m.jpg', '是夏末最甜美的萝莉卷，水蜜桃般的诱惑。当她还在害羞的吮吸着气泡果汁时，淘气的泰迪熊已经投怀送抱。唯美的日系风格，甜美的马卡龙色调，好想要个爱的抱抱。当她有了恋爱的初体验，就会显出九尾狐的原形，不要害怕，快点和她摩擦出爱的火花！', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F48304f87b092a196a47c13915341c1c3_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F05f506d0392910929614e8510441e426_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fd9b4b25137f9742f9887ea1db85b5a2c_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F6539aa8ea2f5c10003498cfa70172a94_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F41391c84bf546bd8d37350240a3b75bc_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fe16461b9e5d85f6951e4a6ef4ed839dc_magazine_web_m.jpg', '90,104', '2018-09-11 21:50:41', '9', '1'), ('293', '穆菲菲', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2F91cc1df25356f306cb9e075f6c9d563e_cover_web_m.jpg', '花开在太阳下，等待情人啊，是不是还在想她？不知道是谁撕碎了阳光把它撒在她的身上，零零碎碎的光影照着细腻的皮肤散出 微微的红晕。她轻轻靠在窗边，甜美的想为她唱一首简单的小情歌，无论是纯情的白纱还是性感的黑丝，脑中挥不去的还是她。', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F9736400611d12b5af2906110da97198a_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F0674a1d9b1753387949c5c6e4e89cca4_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fb378a925fe859f8ebd317f54995efdef_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F8b53124fb20fada5f4a34403105b58fe_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F41186f94f0b24bc8379da15fb2d36e9d_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F360c907438eff05635501fce385bf793_magazine_web_m.jpg', '86,103', '2018-09-11 21:50:41', '5', '1'), ('294', '沈佳熹', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2F1e42137444cbe254a084b6668520ddb9_cover_web_m.jpg', '有女妖且丽，红颜如开莲，素肤若凝脂，绰约多逸态，轻盈不自持，尝矜绝代色。她优雅的烹煮着初秋的荷叶茶，一股清香萦绕在素体之上，一切纯净的词语都难以形容。逆光而坐，美臀诱人，粉绸缠身，妖娆有余，光影似乎与她暧昧不尽，佳人今夜是否有约？', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F1723063cdcfd728c1b3b7723b3f647f4_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F6b530f7ca735bc1784120277f37c9057_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fa7fdfe7505edb8494e280e2c43d1e7f3_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fb23a4d81f93927eb911a03df21491afb_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fb86a0f9a9fe8b45641aef81a433893d5_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F48a6004b152b39e94f6a9cee553cb5dd_magazine_web_m.jpg', '95,98', '2018-11-19 21:17:13', '7', '1'), ('295', '欣凌', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2F39aa1a728872cfe6c751f582ade1894f_cover_web_m.jpg', '眼波荡漾，好似一汪秋水，高鼻俏丽，映衬着红润的樱桃小唇。明媚的窗边，完美的臀线勾走了谁的心魄？蓝白色的长衫下肌肤晶莹透亮。纤长的美腿与尺寸刚好合适的胸围，黄金之比如水晶般完美。她潇洒的站在那里，几点细雨滴滴金。夜幕垂落，透视紫纱开启了夜的魅惑。', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F873255d349de6e785d76aa2a11eeb9ad_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F1268c77d0570d452f7cfa15f25161c91_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F0a34ec83d7193ad6d025a7ac03671b19_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F6c1169d205b3c53ba143cb4be37e634f_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F81f1857ad499aaf944dbbba3445bb7b8_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fe01fbb20da97701e15310ca6301055b9_magazine_web_m.jpg', '68,95', '2018-11-19 21:17:13', '7', '1'), ('296', '于思琪', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2F6ab3820f8df3bdd9e3fd5515eb7b7b6b_cover_web_m.jpg', '我们总在不停相遇，我们总在时间的圆盘中轮回又轮回，中秋是圆，一切皆是缘。我们的女神沈佳熹，颜爱泽，于思琪在美丽的 景德镇为大家带了一期经典的永恒，中秋特辑。三种完全不一样的美艳，她们各自施展着不同的性感。今年的主题不同于一般的中秋 之景，我们主要营造了一丝淡淡的忧郁与感性。身在异乡不能与人团聚的你，是否珍惜和尤果之间的缘分呢？', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fc203e921ec27e016af613ace82fdd984_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fe67e69972c202e8f0198d03d7a55b8c8_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fd6d6e0728e2950713392909255ab1313_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F53417812e2771fb16fff978f2e69d339_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F9bb797457f67d1394dad3ec1ffee951b_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F9d0a006d33baa264a20a9d27287e0974_magazine_web_m.jpg', '84,95,77', '2018-11-19 21:17:13', '8', '1'), ('297', '沈诺馨', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2Fc99e909c0546645f430966b6cbe216a4_cover_web_m.jpg', '这妖娆的水冰月是要收服谁还是被谁收服？无论是诱惑的血滴子还是梳妆镜前的妩媚透视蕾丝，女王需要的永远是气势！鲜艳的玫红色连体比基尼托起了丰满的上围，绝命小护士的尖叫还没有平息，她是谁？她是千呼万唤的百变女神沈诺馨！', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fb1a99da86513e534edace156cc05c671_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fc9c47160b46fceab5afd24dea7f216e6_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fe0653643330fb311c8e91b9a88f89dbf_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F2d113c983d52888ef784c968024bbd18_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fd1e16036de0ca6a1fbaa89f1d885d790_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Ff5d30b749095842bdb4fa1cca16b614f_magazine_web_m.jpg', '103,100', '2018-11-19 21:17:12', '7', '1'), ('298', '雯雯', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2F45d0d066279603fdd9d5997aed0b3150_cover_web_m.jpg', '可妖可媚，可纯可怜。将白色的透视蕾丝花演绎到纯情至极，像悠悠水莲出泥不染。将炽烈的内衣尽情燃烧，魅惑无比，同火红的花簇与花臂幻成了邪恶的魑魅，吞噬着人心。但后背上的天使之翼挥动着又像极了月光女神，这一正一邪，捉摸不定。游离的神情露出一丝享受，楚楚可怜，娇娇诺诺。暧昧的卷发拨动了夜的心弦，又住进了谁的心房。', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F2dcd83fefc2f2b6aa9d31cb1e513d26d_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fc93041e86c3d34945f3cd6c4afd094f9_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F31bbd121cf898738207627cb934183b6_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F755fe9b4c2cd5a1365e1a0ea982bfb2e_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F7e78c7e86295550f6fd658cda308cc0b_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugir