', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2Fa2e3170414c598ea5431f4fc4bedc690_cover_web_m.jpg', '穿破次元壁的女神：我们在二次元里幻想女友，我们在三次元世界仰望女神。萌琪琪的出现将这一切不可能化为无所不能。她性感的拽去粉色的小内裤，白色的衬衫包裹不住硕大的胸器，二次元中她是南小鸟，三次元里她是职场女神。她拿着钢尺拍打着完美的臀部，逆光穿过她妖娆的曲线，烈火红唇，丝袜皮鞭。当次元壁再次坍塌，女神依旧女神。', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F56c95ebe6fa8d483bfd0f88bf1dfa379_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F694c71b0ca3094672bb78f7e526786ef_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F86848bec3a0dcc691bb21f3b1bfd335e_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F0bbccd8a19fd2bd37c289e8afa240fe7_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fb90f49302905115c6d70a7f51b5162ec_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fb6a55a15bb2d58675963bc0e37ddfcc8_magazine_web_m.jpg', '74,89', '2018-11-19 21:17:10', '9', '1'), ('306', '爱丽莎', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2F29400b061bf31c9799ad40c4645bbf2e_cover_web_m.jpg', '她是爱的礼物，爱丽莎。温柔的卷发像熟睡的海浪一样，缓缓的在胸前摆动着。完美的臀线勾勒 出妖娆的体态。粉唇微启，珠光嘤嘤，她被红绳缠绕，在蓝色的墙面前像是海的女儿。昏黄且炽热的摄影灯打 在柔软的皮肤上，无论是连身体操服还是透视蕾丝裙，她微微笑着将自己作为最完美的礼物馈赠予你。', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F50a875ceff7408419a404f291d23b887_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F14a824d81f20bec4bbaba3caed5cb22a_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fd965a6adca5379c437ac21a1747210d3_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F895a750b8a164d4ae97de088c3b6d312_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F309557a12105b508e0537ee49a434fa6_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F235fcee4be72fe710a60d8ad30223675_magazine_web_m.jpg', '80,98', '2018-11-19 21:17:10', '6', '1'), ('307'