031a9c5f12ce8bf91bec5f38fde150e_cover_web_m.jpg', '藏在心底的话对谁说？看一眼就会甜蜜一万年。她就像吃着甜甜圈的小天使，连睫毛都会发出 暧昧的光。把粉色的小秘密全部说出来，让小苹果的比基尼陪我度过整个秋天。牵着她的手一起走，回首间， 霸屏的事业线爱到一万年。', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Feeffa67372c4045fefa3ff24ca16bbb5_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F2fee4f4f3209003788f763877c7ba38c_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F0b228f6a0c0237cc4f511a10d203c38b_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F5eb7315cabf7cbf0016df471eaf7722a_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fb452ec91b01fec653ccf50e2f13cb1a3_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F916abad3866cecd46a54627a71306b29_magazine_web_m.jpg', '74,90', '2018-11-19 21:17:08', '11', '1'), ('311', '小米Kitty', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2F71bc79c640eb41a83efb117c0ad33288_cover_web_m.jpg', '看不够的是不知火舞的巨胸高差连体火焰裙，看不够的是春日野穹的完美大长腿，看不够的 是和风少女的青橙色调，最后爱上的是青涩懵懂同桌的米。亲爱的小米kitty给我们带来的每一次都是视觉惊喜，心中那最原始的欲望就像迎风而燃的火焰，当她身着校服，再慢慢退去的时候，你和你的米在想些什么呢？', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F6d947780acfa06c990b40f97ecd0f55a_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F940454b9a1d4a23889fac3ff52dee45e_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fbcc12153f656716728bcdbfd09218265_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F9171dd17c2eef8b5f122b4da34a74940_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fe913e750564d8d70325025dc2429593e_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F3ef41aec5a0b4bd7e66eaf4417ea5a79_magazine_web_m.jpg', '67,89', '2018-11-19 21:17:08', '10', '1'), ('312', '阿依努尔瓦娅', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2F7f80772b0786eabb9667d87387d6f978_cover_web_m.jpg', '有位伊人，似水柔情。黑黝黝的秀发宛如流水，款款落下，像是相思了很久的情人，那股难以忘记的芬芳。粉色的绸缎是暧昧。黑色的蕾丝是惹火，裸色的真丝是诱惑，一次7种风格，性感不减，反而再次升级！美臀有红唇，长腿与酥胸！唯爱美人唯爱伊', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F673989328a9a0be78bdd75c4d0dc9bfe_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fa52a3ea2a4567b78e76126cada11771a_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F0b13da96e5bdc5f9b25b5688786f3051_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F2b2f7b3af7f8651e26414a14f608c5c3_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F3b36fac9a8826cc33bd45ef5ae7ad9ea_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F09fc6c222fa86a9cfa1e3a89f7c2ff81_magazine_web_m.jpg', '69,68', '2018-11-19 21:17:08', '9', '1'), ('313', '爱菲', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2F3264921ad073e7efa6f0148ed87ef9aa_cover_web_m.jpg', '亲，纸巾给你，擦擦这惊呆的口水吧！这次我们含蓄的送来巨兔的诱惑，再一次爆炸了你的眼睛。成熟范儿的少女爱菲，真的是很爱大家呢。当她掀起粉嫩少女系的运动背心，一对可爱的巨兔轰的一下跳了出来！各位绅士快点接球！御姐范儿的黑色连身裙和帅气的牛仔外套，高冷与火辣的激情碰撞，雪白雪白的诱惑，扑通扑通的心跳，一次冷静又充满欲望的视觉大片，原来着衣更是心动更加诱惑呢，兔兔宝贝等你来收藏哦！', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F6cea46c8bae86b0e2e5a1e3cf23f1d64_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fe9bf19b2c2f2b28604dc1a1ba14c9ea6_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F44806798da17719740d4712c614363f8_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fc3644ba13459add8075eb7ad3bffe2c1_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F386a0d870850e1df11ee18080d1ff915_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F089ddc40189ed625fa512c10a63acfe2_magazine_web_m.jpg', '91,100', '2018-11-19 21:17:08', '8', '1'), ('314', '宁然', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2Fbae4c5531e0618b15a6d4a802c062588_cover_web_m.jpg', '当紧身皮裤再次包裹腿玩年，香艳的身材难以束缚，暗紫色的野蔷薇优雅的绽放着，完美深V下开出欲望的蕾丝花。红唇嗜血，鲜体纤纤，我愿变成饕餮，吞下这美好的一切！', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F06f3ce71f5ce0348d279de6192973e3f_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fc7fadf8439698bc7f7dcc42dc770313a_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F2eda9c044bb61e9d0d24cf748acf4f06_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F89c29f3f1544b1877aa1cb59b91bf329_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F486f92bb26260f4f853781bf078de82d_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F6566e5cbd417c66248a490c1802dfe4e_magazine_web_m.jpg', '68,95', '2018-11-19 21:17:07', '9', '1'), ('315', '周予然', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2Fd3a5b29a482906a76db9c1b0a7cf02d8_cover_web_m.jpg', '恋爱就像选糖，别再眼盲。闪亮钻石糖，让爱发出光芒。她一身钻石霓裳惊艳亮相，自带明星相，过目难忘。当红花开遍蓝绸，肩上绽放的彼岸花微微露出，她回眸一笑，无论是黑色蕾丝还是白雪丝绸，都压不过她钻石般的女神光芒！', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F4c2ed02de3180e4515e23e9af8af8506_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fdc57b3b6e16565bea496eb22155695c9_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Ff1e691bb975e8466dedd62a375e09de1_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F4aa192faec43a0361b2d20d8af6f32bb_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F69ba683ea6e30a9162ca1bc86aa2c7da_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F4b6452b0bb5c4bed7189df554b9a8b26_magazine_web_m.jpg', '79,64', '2018-09-11 21:50:41', '8', '1'), ('316', '周大萌', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2Fd2e13d323b0a03efe69002df43730cca_cover_web_m.jpg', '经历的多了，忘记了淡泊，不敢惹相思，禁不住，逃不脱。忘记了珍惜，贪食着诱惑，不敢纵欲望，捆不住，心膨胀。眼前这傲娇的女孩如同熟透了的蜜桃，令人垂涎。翘臀，丝袜，透视，虐恋。你不知道藏在诱惑背后的是楚楚可怜还是万种风情，我只知道这种诱惑绝对难忘。', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F45e058fb2acb97fe2182dc600c6fc21e_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fd602507849052cd47a9a28c725146a01_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fb541b384f4fe17453855beff88144cbd_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F545fff42a19be408a02aee22ebf764e6_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fe013fe1a1577963ab32358a3210feae6_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F7766f7ad8c341dd2ad9dd5f3542c6d85_magazine_web_m.jpg', '96,77', '2018-11-19 21:17:06', '13', '1'), ('317', '艺宁', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2Fca0501588ca3e6440a814f462ae91960_cover_web_m.jpg', '清透的皮肤犹如刚从牛奶中走出来，粉红咬唇，美臀霸屏。忧伤的小气质似乎有什么秘密要告诉我，完美的锁骨，魅惑的眼角。身上每一处无不散发诱人的费洛蒙。她捋了捋耳边垂下来的发丝，抿了一下嘴唇，她说：你愿意做我的契约爱人吗？', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F7ec456667c121f48453dc8e7a1d40725_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F303e0648224e0a17c186fa5bf2453b0e_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F04bbed4946afe647915151ddfc50be5b_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F885105172353e5c466baec45d7f2c2c3_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Faa27c503415bbb3870bc914c882c8762_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F8f312a2626a83ddf16dba3bb27839769_magazine_web_m.jpg', '87,79', '2018-11-19 21:17:06', '13', '1'), ('318', '朱赢', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2Fd1e505228f349ceb3215a684f5294d71_cover_web_m.jpg', '我怕来不及，我要抱着你。直到肯定你是真的，直到不能呼吸。不愿等到失去才学会明白珍惜，不愿失去你的消息，在这夜深寂寞里。女神的归来总是能掀起内心的波澜，当我们再次见面，她更漂亮了，精致的五官，栗色的瞳孔，卷翘的睫毛，红唇粉润，还伴着魅惑一笑。依旧那么有魅力，还是