INSERT INTO `tb_ugirls` VALUES ('369', '夏雨桐', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2F3496833a3e4400e3b6421791f7e11f60_cover_web_m.jpg', '我的心借了你的光，是明是暗，多敏感又难缠。依偎在窗旁，窗外的光隔着白纱投进心中的房， 雪白的身体，清澈的眼光，醉人的酒窝，春心荡漾。淘气的小猫，在粉色蕾丝里挠挠又抱抱，舔舔手指，发出 嗲嗲的微叫，害怕她逃跑，又不想放掉。鲜花浴袍，浓烈鲜艳，不同之前的含蓄和宠溺，更多了一份炙热的骄 傲。黑色的皮衣搭配豹纹蕾丝，野蛮又性感，狂野又高调。一套大片多种情感，是爱是恋，多喜欢还想要！', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Faa1b086f989e62a2335ff50c49ec0621_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F51e988826d36b73cd4c03012a1ae2ec0_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fe06a4a0d7501e12982e768b4706fb41f_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F8659074c5177c00fc876f4fe6e69d3ed_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fc8b5de31db7c46db7333ac667f27ff49_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Ffc47b7f974c380f7af60b15cf6ba3fba_magazine_web_m.jpg', '89,80', '2018-11-19 21:16:49', '12', '1'), ('370', '于梓馨', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2F62ca8cc17082aa265844447db9bf762b_cover_web_m.jpg', '这稍纵即逝的美好，难以忘却的美丽，微小而确实的幸福。如此美丽的女子，一身白衣，长发乌黑 柔顺，淡淡的红唇，她不需要摆出夸张的姿态，这有些含蓄的遮掩，反而难挡美艳的存在。蕾丝长袜搭配透视 睡裙，纯白飘然，像个不食人间烟火的仙女，转眼间，黑色的吊带袜席卷画面，性感像火焰喷涌，这一瞬间， 幸福仿佛如同阳光沐浴全身，喜欢你，小确幸。', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F4317b8660f13b0826380d5ef0c4bc963_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F7621a57ace831fa0c8616fff6497edf3_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Ff5ff39f3f5304a45e8b8b4952fdca368_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F998526fe032e1503a0a609023a2d4c32_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F187fa7901fa8c4e89a9418ced46c13de_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F4e7bae