诱惑，简直甜到窒息 。摄影师在拍摄这套照片时，并没有因为女孩的名字叫糖果，便施加五彩缤纷的强视觉，而是尽可能用到简 单的色调，黑白与裸色，来凸显女孩甜美的气质，我想，这样的感觉更加能让观者甜而不腻，甜到心里。', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fd191e880f78e68280f6b17bafa8f2a85_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fad696d55a60a5cdb6cbaa7ab68546c5e_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F65465f42ce411fcc7b6eec5326674b60_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F1c1f4a83ec7f35bf4c13e610caa94b45_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Ffa0914c71c7842009c080ff3ee2ed5f2_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F32722382783243849e7b262d57c38746_magazine_web_m.jpg', '64,77', '2018-09-11 21:50:41', '5', '1'), ('424', '刘天天', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2F6461974f346b848a1aeaa64550eaaeac_cover_web_m.jpg', '突然有一天，哭过笑过的瞬间，记忆停留的那一天，你站在我心里的那一天。刘天天，我愿意把最温柔的词汇全部给她，她眼中含着泪水完成了拍摄，如同雨后的鸢尾花，脱俗自在，却在风中等待着怜花之人的到来。胸口绣着花型的纹身，没准是上辈子留下的记忆符号，那青色的纹身隐藏在雪白的蕾丝之下，盛开在诱惑的胸线之间，迷人至极。灰色的韩式睡裙，让腿部的线条更加修长。浴缸前的女仆装，诱人的微笑线，不知道她的服务到底怎么样。最喜欢的就是这套浅蓝色的缎面睡裙，像是把温柔一丝一丝串联，再配上这恬淡的浅笑，与眼中闪烁的泪光形成强烈的对比，不知道这是像感动，还是可怜，总之，这笑泪似水柔情。', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F4615ea6dd841a4405ed5bcae4eae0759_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fea2581040f2cac3d448ac68adc6d5830_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fef401a80aef92a45a0c2a89b96c865f6_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fa810e686cd7c71fe9215440c54ae36cd_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F316851d232f36396a0bb10570bdd6f89_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F01383134d225a9162f26102287d9fdfc_magazine_web_m.jpg', '73,64', '2018-09-11 21:50:41', '36', '1'), ('425', '佳宝', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2F9b24c5fdb04d010bcc7ef47f9e657a9e_cover_web_m.jpg', '有人说，童话里的爱情都是幸福的，有人说，童话里的结局都是骗人的，尤果说，童话里的佳宝是充满诱惑的。可爱的佳宝留着娃娃头的发型，她似乎不太习惯微笑，总是不经意间皱着眉头，第一套造型是灰色的毛线衫，她跪在窗前，好像灰姑娘一样，总是紧锁愁眉，但却因为一些微不足道的小事露出暖心的微笑。第二套造型在浴缸里完成，浓烈的对比色，让佳宝像极了安徒生童话里的小美人鱼，泡沫是她的衣裳，当鱼尾第一次化作双腿，她兴奋不已，不是因为双腿的美丽，而是因为对爱情的渴望。第三套造型是纯白的薄纱，当微微透视的薄纱与娇嫩的肌肤紧紧包裹在一起的时候，仿佛是雪花第一次亲吻大地，仿佛是白雪公主的回眸一笑。最后一套造型，她穿着碎花的围裙，盘坐在吧台的座椅上，这次她又是童话里的谁呢？', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fff3f923ea96bda05b3834b41ff03f83e_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Ffb248e48a1493ee54ff475abf1175062_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fc2ff86efc0c28d9e601d261a8ed3b98c_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fa2bb9945adc81c88442d3ac13cbf92d1_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fed6e4e4fc821b58c8395d18e66306177_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F44ad4ab28830063c4e2d5e7d0f0e77c9_magazine_web_m.jpg', '73,95', '2018-11-19 21:16:33', '17', '1'), ('426', '妮可', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2F6b5d46954f12ce376e2f3d74f66cf7ad_cover_web_m.jpg', '远处走进来了一位大美女，那双白闪闪的大长腿，看的人目不转睛。眼神往上走，蜂腰纤纤，傲人的上围真是人间极品。肌肤似雪，红唇似桃，粉粉的双颊娇俏迷人。一双大眼睛在睫毛的包裹下露出楚楚动人的光，微微一笑的时候，如同在火树银花的夜晚吃上了一口暖暖的奶酪，回味无穷。她起初穿着男友的白衬衫，黑色的内衣隐隐约约的露出来，后又换上了透视的白纱，内搭也是白色，那气质好像午后的香水百合，时而浓烈时而淡雅。灰色的吊带衫好像拉丁舞裙，流苏像是有生命一般在胸前摇摆。浴缸里诱惑的皮质连身泳装，她手握金丝鸟笼，像是爱情的囚徒，又像是爱情的猎手。她越走越近，我忍不住打了招呼，hello！妮可。', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F5c92b608ec63a8907e51db247bbbadca_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fb4df9a0a8809ad2136fc19ce6c71f9d7_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fd79635c58f7c931e49edb1ae403aaab3_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F02c5016ce8446fd79cb6ee7817d561ab_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fe0a8bdcfedfc3cb53fdba03802a6ff83_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F54bbb5d87e2e393107bac544d76571c4_magazine_web_m.jpg', '64,77', '2018-09-11 21:50:41', '12', '1'), ('427', 'Pinkbaby', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2F3602877ffae26032f5f6f922fe7ae297_cover_web_m.jpg', '眼看着圣诞将至，你找到了平安夜送苹果的她吗？如果还没有，那么把你的爱收集起来，送给我们的粉红宝贝Pink baby吧！她穿着白色的连衣裙，金属肩带的垂落让性感加分。红底的高跟鞋，渔网的连裤袜，黑色的蕾丝，她像一个骄傲的芭比，得意的展示着自己的性感与完美的身材，深邃的眼窝，高挺的鼻梁，红嘟嘟的微笑唇，如同雕塑般的完美五官，一定是上帝偏心的杰作。她摆出各式各样的动作吸引着相机的快门，她露出迷人的微笑让我有了恋爱般的甜蜜。', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F486b203318a39a152e18f504509af53b_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F52cf3cda8c936a276d0aa8c9b9ec8dc2_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F68919dc5b03ddfafabc8777c9af3b6ef_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F4e7b133e2d53b70ee4b5785bb14b4971_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F7859a6895c742c740a2ed6472c441269_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F5a6ab5c9849810f65624f75d26f6773f_magazine_web_m.jpg', '103,102', '2018-09-11 21:50:41', '10', '1'), ('428', '小兔', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2F15016c070002359cd32fabe6f22b159c_cover_web_m.jpg', '每一年的圣诞节，的福利都非常的令人期待，今年我们带来了两只可爱的小鹿，一只是甜萌萝莉Tina，一只是超波萝莉小兔，本次拍摄一共有四组造型，每一套都非常的令人着迷，可爱的红鼻头，卷翘的睫毛，无辜的眼神，请让我敞开心扉，让这两只小鹿随意乱撞。谁能想到，让萝莉穿上皮衣，这套极致诱惑难以抗拒。皮草，烛台，蕾丝，连空气都是性感的味道。最后一套是tina送上的独家记忆，钻石糖的毛衣裙，她双手捧着礼物，微笑的看着你，送上圣诞节最甜美的祝福。', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fb8c8385b53c4b57f10937d829039da73_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F0924ea28572d70eb4ea80fc8ec72d274_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F0a6e34cc736e6d369eefd4e14109f7a2_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F42846e7823197adcd620a357e7d0b769_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F82f9dc239971242228d77fdabb998e0c_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F975ddceba4c405d2b5dc272694970ad8_magazine_web_m.jpg', '89', '2018-11-19 21:16:32', '15', '1'), ('429', '司徒林', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2F5c70b1d812957c22067dcb15a7297151_cover_web_m.jpg', '她穿着粉色的毛衣，露出性感的香肩，完美的身材将毛衣撑的满满的，看起来像只粉色 的毛绒兔子，俏皮可爱。粉色的蕾丝见多了不奇怪，可是如此劲爆的好身材，精致的蕾丝花都被撑到变形， 连摄影师都看不下去了，赶紧换上了雪白的束身衣，她娇滴滴的睡在沙发上，头发散落着，饱满的红唇微微 张开，喘息均匀，难道爱情故事里的女主角，不就是这个样子吗？', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F0a8669b0a249a4918809b910ee8b67a8_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F85be0ed11985d1dfd7614b62df9896bf_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Ff84e901917baa427049ec0ba925b466b_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F488fc8e63f1a9a30885f006f38d1a665_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F71fc6e870d524a6933bf5c80831aa64d_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fae670aad3a03312d118b20ed5c0d0760_magazine_web_m.jpg', '80,77', '2018-11-19 21:16:32', '12', '1'), ('430', '赵娜娜', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2F23ebfa9e5f82dcc2365eba6f7465d939_cover_web_m.jpg', '洁白的床单上，她换上男友的衬衫，梦醒时分，白衬衫上还有一丝阳光的味道，她微笑的面 对镜头，摆出忽而清新，忽而诱惑的动作，让浓烈的性感有了一丝清爽的甜美。时间总是那么快，树枝上开 出了霜花，候鸟也已远去。2017年悄无声息的一去不回，推开房门，可爱的赵娜娜还在，她换上了黑色的 羊绒短衫，露出粉肩，美腿纤长，她翘起双腿，淘气的笑着，还是那可爱的马尾辫，和之前的一样，还是记 忆中恬淡的香水味，就像规律的格子衬衫，简单，舒服。仰望天空，已经看不见候鸟远去的影子，但霜花还 在，手心的温度还在，2017却不在。‘’', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Ffa4b195f2f678f1e31c6c2496a10503c_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%