INSERT INTO `tb_ugirls` VALUES ('431', '杜小雨', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2Fc9f6ed5c389652a96f498a27143b4bc3_cover_web_m.jpg', '北方的冬天，风总是刮的那么冷冽，偶尔飘落的雪花带来了一丝浪漫，可室外的天气真是滴水成冰冷到彻骨。南方的冬天，寒冷在潮湿的空气中肆意吞噬，冰凉的手脚与湿冷的被窝让人不禁发抖。打开了显示器，看到了杜小雨，一个名字有些清冷，但微笑却可以温暖整颗心的少女，她给这个寒冷的冬天带来了阵阵暖意。黄色调的背景光，她一袭绿裙坐在窗边的沙发上，红花绿植，度假风的感觉扑面而来。粉色的露肩羊毛衫，把小小的性感加倍放大。她拨弄着胸前的碎发，迷人的模样就像初榨的椰奶，甜而不腻，唇齿留香。泰式的床单上，她伸着懒腰，像一只午睡醒来的暹罗猫，优雅又俏皮，她早已摆脱了第一次拍摄的青涩，她展露出自信又性感的一面，喜欢她，温暖的小雨。', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fd30bf42d4e43a41718a6a6bf1f948967_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F2d0449ca93f3096fc0d4aa60c1cdba8c_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F70029a0173defe7bb35769f593cb2fa4_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Ff9368f28d1d5b2f7509198cf21743998_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fad0c0a37b8937efa3c3b58184c168aa4_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F40e683b19d7248ef1b9115fffaffacd8_magazine_web_m.jpg', '64,77', '2018-09-11 21:50:41', '9', '1'), ('432', '张之龄', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2F2881e52d625b556c51081ae58c70c1c1_cover_web_m.jpg', '她用手指不停的缠绕着自己的卷发，又推了推镜框，微微抬起双眼，早已涂上口红的嘴唇有些干涩，她用舌尖作画，抿了抿嘴唇，露出一个极具诱惑的微笑，她解开衬衫衣领的白色扣子，雪白的香颈一下露了出来，还闻得到她清晨喷在耳后的香水味，有玫瑰，有烟草。她将手慢慢滑下来，一颗，两颗，三颗，此时此刻，你还在等什么？', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F861b9b59a86d85142219b2105a85042b_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F087dc531c761a0ea5b6c22012e94aa5a_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F601a4eb01750fe2df8fdf35c1132be82_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F0dc1126578a0f81e3e4c9f008669a875_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F50d2c4db507b93335ffedd958fae3af1_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F20dbcb09b17f18bc9739e438bd7a05b4_magazine_web_m.jpg', '89,77', '2018-11-19 21:16:31', '12', '1'), ('433', 'Shirley', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2F3eeb15732588aca5d19e62672b15f0c8_cover_web_m.jpg', '嗨，我们在一起四年了，这将近一千五百天的相处，我看着你慢慢变的成熟，你看着我渐渐长大。你对我的爱呢？有没有减淡或者更加强烈？希望接下来的时间依旧对我深爱不变，我也会努力变的更好，我们说好不分开，不见不散。', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F74355e16d7f7fc28560021c370c8bce9_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F744a49d55d07e8471d30c17b17a2cab2_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F19888a56a71403e6dac47db10f9a49f7_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F4acb87070a002b0511d96da886267eec_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Ffd506993dac9487e429c91a6b6efa71a_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F3f79f66f30911f544b38683a90871cb2_magazine_web_m.jpg', '95,98,100,64', '2018-09-11 21:50:41', '11', '1'), ('434', '叶汐', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2F468d4c39ce4c00f93116a7a09333b186_cover_web_m.jpg', '她撕开这件灰色的羊毛衫，胸前美景乍现，性感如同洪流喷涌而出，她优雅的摆着格式姿势，迎接着摄影师的快门声。她说她最喜欢那件红色和风内衣，当柔软的丝绸与细腻的皮肤相摩擦，那种冰凉的瞬间似乎可以加速心跳。我到最喜欢浴缸中那套雪白的蕾丝内衣，与网袜相配诱惑至极，清纯的就像初出水面的小人鱼。与那套黑色的绸缎睡衣相比，风格完全不同。黑色的蕾丝绽放在黑色的绸缎里，神秘的感觉总能激发更多的欲望。你是否对叶汐动了心？一叶倾心。', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fa1718cea4b8ade9a9d694071ce6850bf_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F0e368424ee86e78f004e7bbb2b74b7b5_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fc6dc7243710e85fffddd150807a31fc8_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Ff383839b12638b526921523aa3bc74a4_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F7e3d35e5f6c881fc9b143103e154a5f3_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F5fe3d526bca85936b52185af2e63130c_magazine_web_m.jpg', '22,77', '2018-11-19 21:16:30', '12', '1'), ('435', '穆菲菲', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2F89be67a588bdbdea72f1ffab42c4f000_cover_web_m.jpg', '冰雪拥抱着大地，把寒冷刺入骨髓，蓝天亲吻着雪花，阳光将它融化。远处走来的女子，她一身银 装，看起来比这白雪更加刺目，放肆的冷风吹起她耳边的头发，划过她雪白的皮肤，她抬起双眼，依然骄傲 的微笑，完美的展示着自己的曲线，为大家带来了一组超震撼的视觉大片，真的很热血呢！无论如何也要为 菲菲的勇气鼓掌，在零下十几度的雪地完成性感大片的拍摄真的不是一般人可以挑战的！各位看官一定要多 多捧场哦！', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F679b7e103718e7415e713ea1b57b4dbe_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F1dce5cd9365e4ec23abca1c0bbb82159_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F4f2ada87ff3c3a3ca68a155d6a67481f_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F2802a62c670e600c8444ea6a7b7c191d_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fa0e825fd15d9740f1fdec5ea48bb9dfc_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F52f27644d06e954b581c971837f4c7dd_magazine_web_m.jpg', '84,77', '2018-11-19 21:16:30', '11', '1'), ('436', '贝拉', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2F406eb1012fdb01982383d7b2417edbae_cover_web_m.jpg', '她躲在花涧中偷窥着你，和肤色相近的花瓣散发出优雅的体香，她半跪着，露出迷蒙的神情，微微的喘息声让人心动不已。就连运动背心都变的性感了起来。这裸色的连身内衣因为金色的线条变的华丽起来，紧贴着皮肤，完美的曲线，又像迷人眼的渐欲乱花，让我的头脑不再清醒，浴缸中，她如同出水的芙蓉，鲜而不艳，清而不妖，但骨子里的魅惑缺与水不能相容，眉眼之间的美丽无人不为之动容。', 'https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F40f15f53884787bfcc234cfa05624ed0_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F258fd8b60b132534cfb6dae140d625b9_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Feffe4be8c4f1acf25d1c941930e0cc7d_magazine_web_m.jpg,https%3A%2F%2Fimg2.ugirls.tv%2Fuploads%2Fmagazine%2Fconte