巴厘。8位女神，5个名额，花落谁家，靠你助力！是爱撒娇的甜姐儿艾小青？还是柔情似水的程瑜西？猛料十足的何嘉颖也不想放弃，热辣似火的萌汉药我对你也很上心！长腿女神梦心玥的大片一定值得收藏，那么早已封神的艺轩谁会舍得不理，对久不见的筱慧也充满了期待，不过球球才是我心底最深沉的爱！到底带谁去旅行？点开尤果圈，缩短她们梦的跑道，创筑她们爱的作品，她们在尤果圈等你，快点为她助力！', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fd563a28ab2fca53dbe04d68adb1c6c57_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F894ee92112b62ee541e3a492264085d6_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F8ba7ef7d1a550ec26943a2e3fd44c7ff_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F0d51a72c7d3b7135fd254a5df83e6463_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Faa33351530a7200aa5fab10afaccf0a9_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F74b3dcdd15ad9a2f075ce8ae8b856347_magazine_web_m.jpg', '90,64', '2018-09-11 21:50:41', '19', '1'), ('491', '萌汉药baby', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2Fe8c8cdd4d8c28bbd82f296fdf72f1cca_cover_web_m.jpg', '0', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fa38b623f0c467a56e25fd689b22db306_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fa0a96ce1fbcdc233b9a2b90bacbae636_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Ff0fcd7ea2b8202abb5168f1673d89cd2_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F51fe5280fcce7dc6158e739eeec80474_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fa01edc1c6fb76068d18146ca86626e2b_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Ff0bdba568160b398e2b0aa0ccf32e014_magazine_web_m.jpg', '101,100', '2018-11-19 21:16:15', '14', '1');
INSERT INTO `tb_ugirls` VALUES ('492', '韩安琪', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2F926fa5745ef566047b3434f27e4358a2_cover_web_m.jpg', '不知道如何提笔，不知道如何描述，在她的面前，我似乎词穷了，当她换上第一套透视泳装的时候，眼球就不受控的牢牢钉在了她的身上。傲人的身材，纤细的腰肢，似雪的皮肤，还有那柔软的嘴唇，一切都是那么的美好，她像夏娃一样自由，在恰好的时间，展示着恰到好处的完美。还有那件粉白色的连身裙，特殊的穿法真是令人血压升高，她倾身躺在洁白的浴缸里，温暖的黄色光线让画面充满了暧昧。至于最后那套比基尼，其中的好风光，就有你来细琢了。', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fde1e1edb105359649191f8a2743b5487_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2Fab332a281fa2192f1810be8d1ece01c0_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F8319b78e4ae95c6bb96b30e743169f81_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F73855fc17744a4ec4cad4ed2f51ffeb6_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F0e805f6ab028e63c5da2ed218f9146fe_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F39d41890f352f068055541c966c64d67_magazine_web_m.jpg', '69,101', '2018-11-19 21:16:15', '16', '1'), ('493', '尹菲', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcover%2F3ff56cb0bb76175b69fea6733aef1172_cover_web_m.jpg', '蓬松的中长发，性感的肤色，柔美的曲线，精致的五官，她在镜子前炫耀着完美的自己，我在 镜头的这一边被迷的情非得已。如果说黑色的紧身裙是欲望的开始，那么那件白色的迷你旗袍就是燃烧我的 致命一击，那纯净的性感难得一见，既有东方的韵味，又突破了诱惑的界限，还有那套热辣似火的比基尼， 我想它一定是缩水了，才会那么小一点点。', 'https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F3d1a49a422345a6598a2f637eaa4e103_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F96ff121b4dec615037140bd94b801b0b_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F75905600a0af187734148b7b2a81aa60_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F6a092f463005a68c1472df4e2d602341_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fcontent%2F69810b7b2ba4540ba5b9737469d8634d_magazine_web_m.jpg,https%3A%2F%2Fimg.ugirls.tv%2Fuploads%2Fmagazine%2Fconten